export default class MyDocument extends Document {
    // 如果要重写render 就必须按照这个结构来写
    render() {
        return (
            <Html>
                <Head>
                    {/* <title>eleven-boke</title> */}
                </Head>
                <body>
                    <Main />
                    <NextScript />
                </body>
            </Html>
        );
    }
}
